"""
Максимальная сложность - O(N**2)

# Делим список на 2 равные части, каждую из них сортируем выбором, а затем делаем упорядоченное слияние
"""
import time

def merge_sort(l1, l2):
    i = 0
    j = 0
    c = []
    while i<len(l1) and j<len(l2):
        if l1[i]>l2[j]:
            c.append(l2[j])
            j += 1
        else:
            c.append(l1[i])
            i += 1
    c += l1[i:] + l2[j:]
    return c

# Рекурсивное деление на элементы и слияние
def split_and_merge(a):
    N = len(a)//2
    a1 = a[:N]
    a2 = a[N:]

    if len(a1)>1:
        a1 = split_and_merge(a1)
    if len(a2)>1:
        a2 = split_and_merge(a2)

    return merge_sort(a1, a2)

